  internal string GetClustersPattern(OtfGlyphInfoList glyphList)
  {
    StringBuilder stringBuilder = new StringBuilder();
    for (int start = glyphList.Start; start < glyphList.End; ++start)
    {
      OtfGlyphInfo glyph = glyphList.Glyphs[start];
      if (glyph.CharCode > -1)
      {
        char ch;
        this.m_characters.TryGetValue(this.GetClass(glyph.CharCode) & (int) sbyte.MaxValue, out ch);
        stringBuilder.Append(ch);
      }
      else
        stringBuilder.Append('X');
    }
    return stringBuilder.ToString();
  }

